    })
  };

  return (
    <div className={styles.container}>
      <form onSubmit={handleSubmit} className={styles.form}>
        <input
          type="text"
          className={styles.input}
          placeholder="Населенный пункт, улица, дом"
          value={address}
          onChange={(e) => setAddress(e.target.value)}
        />
        <div className={styles.rooms}>
          {['Студия', '1', '2', '3', '4+'].map((room) => (
            <button
              type="button"
              key={room}
              className={room === rooms ? styles.activeButton : styles.button}
              onClick={() => setRooms(room)}
            >
              {room}
            </button>
          ))}
        </div>
        <div className={styles.housingClass}>
          {['Бизнес', 'Комфорт', 'Эконом'].map((hClass) => (
            <button
              type="button"
              key={hClass}
              className={hClass === housingClass ? styles.activeButton : styles.button}
              onClick={() => setHousingClass(hClass)}
            >
              {hClass}
            </button>
          ))}
        </div>
        <input
          type="number"
          className={styles.input}
          placeholder="Площадь"
          value={area}
          onChange={(e) => setArea(e.target.value)}
        />
        <input
          type="number"
          className={styles.input}
          placeholder="Этаж"
          value={floor}
          onChange={(e) => setFloor(e.target.value)}
        />
        <button type="submit" className={styles.submitButton}>
          Предсказать цену
        </button>
      </form>
    </div>
  );
}

export default HomePage;
